import logo from "./logo.svg";
import "./App.css";
import "./index.css";
import { ReactDOM } from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

import MainPage from "./Pages/MainPage";
import Login from "./Pages/Login";

function App() {
    return (
        <div className="App">
            {/* <MainPage /> */}
            <BrowserRouter>
                <Switch>
                    <Route path="/">
                        <MainPage />
                    </Route>
                    <Route path="/login">
                        <Login />
                    </Route>
                </Switch>
            </BrowserRouter>
        </div>
    );
}

export default App;
